import React from 'react'

const Notfound = ({search}) => {
    return (
        <div>
            <h1>
            คำที่คุณค้นหา {search} ไม่ตรงกับผลลัพธ์ใด ๆ
            </h1>
          
        </div>
    )
}

export default Notfound
